    name: "Tamara Baker",
  },
  {
    imageSrc: `${pathName}/speaker-component-10803.png`,
    name: "Eugene Chuvyrov",
  },
  {
    imageSrc: `${pathName}/speaker-component-1124.png`,
    name: "Douglas Crockford",
  },
];
